package com.shangji.user.entity;import com.common.base.entity.BaseEntity;/** * . * * @CreateDate: 2019-05-06 上午10:37:53 * @version: V 1.0 */public class UserRole extends BaseEntity {        /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     *      */    private Long id ;    /**     * 登录id     */    private String loginId ;    /**     * 权限id     */    private String roleId ;    /**     *      */    private java.util.Date createTime ;    public Long getId(){        return this.id;    }    public void setId(Long id){        this.id=id;    }    public String getLoginId(){        return this.loginId;    }    public void setLoginId(String loginId){        this.loginId=loginId;    }    public String getRoleId(){        return this.roleId;    }    public void setRoleId(String roleId){        this.roleId=roleId;    }    public java.util.Date getCreateTime(){        return this.createTime;    }    public void setCreateTime(java.util.Date createTime){        this.createTime=createTime;    }}